import { Route, Switch, Redirect } from 'react-router-dom';


import GreatQuotes from './pages/GreatQuotes'
import AddQuote from './pages/AddQuote'

function App() {
  return (    
      <Switch>
        <Route path='/' exact>
          <Redirect to='/GreatQuotes' />
        </Route>

        <Route path='/GreatQuotes' exact>
          <GreatQuotes/>
        </Route>

        <Route path='/AddQuote'>
          <AddQuote />
        </Route>
      </Switch>    
  );
}

export default App;
